   "source": [
    "# plot components\n",
    "components(dcmp_sample) %>% autoplot()\n",
    "\n",
    "# plot trend\n",
    "components(dcmp_sample) %>% \n",
    "  as_tsibble() %>% \n",
    "  autoplot(num_sold, colour=\"gray\") +\n",
    "  geom_line(aes(y=trend), colour=\"#D55E00\") + \n",
    "  labs(\n",
    "    y = \" number of mini-courses\", \n",
    "    title = \"Total sales of Kaggle mini-courses\"\n",
    "  )\n",
    "\n",
    "# plot seasonal-adjusted data\n",
    "components(dcmp_sample) %>% \n",
    "  as_tsibble() %>% \n",
    "  autoplot(num_sold, colour=\"gray\") +\n",
    "  geom_line(aes(y=season_adjust), colour=\"#0072B2\") + \n",
    "  labs(\n",
    "    y = \" number of mini-courses\", \n",
    "    title = \"Total sales of Kaggle mini-courses\"\n",
    "  )"
   ]
